measurements.description:
Two flowers and 15 buds on 17 wiry, erect inflorescences, 17-cm in length, borne on a plant 33cm in diameter,
	grown in moss in a 17-cm basket; leaves linear, 23-cm in length, 1.6-cm in width; 
    sepals white, flushed and veined dark purple on reverse, pink tomentose, appearing mauve, caudae dark purple;
	petals white; lip light pink; column yellow;  
    substance firm; texture matte; a recently described species from Columbia.
